import React from "react";
import { Col, Figure, Row } from "react-bootstrap";
import { useDispatch } from "react-redux";

export const ProductGrid = () => {
  let baseLink = "https://buckettelexpress.s3.amazonaws.com/FOTOS+GOFIND/";
  const dispatch = useDispatch();
  const produtos = useSelector((state) => state.orcamentos.produtos);
  return (
    <div className="bodie">
      <Row
        style={{ height: "100%", minHeight: "100vh", paddingTop: "20px" }}
        className="justify-content-center align-content-start"
      >
        <Col xs={11}>
          <Row className="text-center">
            <Col style={{ padding: "0px 0px 30px 0px" }}>
              <h1>Cat√°logos</h1>
            </Col>
          </Row>
          <Row className="justify-content-center">
            {produtos.map((produto, index) => {
              return (
                <Col
                  key={index}
                  xs={3}
                  className="text-center"
                  style={{ paddingTop: "20px" }}
                >
                  <a
                    target="_blank"
                    rel="noreferrer"
                    href={baseLink + catalogo.nomeArquivo + ".pdf"}
                  >
                    <Figure>
                      <Figure.Image
                        className="imgCatalogos"
                        alt={catalogo.nomeArquivo}
                        src={baseLink + catalogo.nomeArquivo + ".png"}
                      />
                      <Figure.Caption style={{ color: "white" }}>
                        {catalogo.caption}
                      </Figure.Caption>
                    </Figure>
                  </a>
                </Col>
              );
            })}
          </Row>
        </Col>
      </Row>
    </div>
  );
};
